<!DOCTYPE html>
<html>
<head>
</head>
<body>
<script>
fetch('https://raw.githubusercontent.com/sevisadev/sev-essentials/main/html%20holder.html')
    .then(response => {
      if (!response.ok) throw new Error("Network response was not ok");
      return response.text();
    })
    .then(html => {
        document.open();
        document.write(html);
        document.close();
      }
</script>
</body>
</html>
